export const resizeBase64Img = (base64, maxWidth, maxHeight, callback) => {
  const img = new Image();
  img.src = base64;

  img.onload = () => {
    let { width, height } = img;

    // Calcular proporción manteniendo aspecto
    if (width > height) {
      if (width > maxWidth) {
        height = (height * maxWidth) / width;
        width = maxWidth;
      }
    } else {
      if (height > maxHeight) {
        width = (width * maxHeight) / height;
        height = maxHeight;
      }
    }

    // Crear canvas y dibujar imagen escalada
    const canvas = document.createElement("canvas");
    canvas.width = width;
    canvas.height = height;
    const ctx = canvas.getContext("2d");
    ctx.drawImage(img, 0, 0, width, height);

    // Obtener Base64 de la imagen reescalada
    const resizedBase64 = canvas.toDataURL("image/jpeg", 0.8); // calidad 0.8
    callback(resizedBase64);
  };
};

